Big O notation is a mathematical concept that represents the worst-case time complexity of an algorithm. It provides insights into how long it takes for an algorithm to run and helps in predicting its efficiency. The formula used for calculating Big O notation involves describing the input size, which indicates the number of elements or data points that are being processed by the algorithm, and then comparing it with other algorithms in terms of their running times.

For example: 

BigO(n^2) means if n increases linearly, the running time will increase exponentially;
BigO(nlogn) means if n grows logarithmically, the running time will also grow logarithmically;
BigO(1) means if there's no input at all, the algorithm has a constant runtime.</s>

Big O notation, also known as the Big-O notation or Big Ω notation, is a mathematical concept that indicates an upper bound on how complex an algorithm's output will be. It represents the maximum number of operations that can take place before reaching an optimal solution in terms of time complexity. The term "Big" refers to all possible values of n and "o" stands for "order."
The formula for calculating Big O notation:
f(n) = O(g(x)) means that f(n) grows at least as fast as g(x), but no faster than c * g(c^2);
For example:
If f(n) = O(log(n)), then it means that at most log(108) times a function with logarithmic growth rate is executed;
In contrast if we say f(n) = O(sqrt(n)), then it means that at maxorial square root of elements in input array are queried;
This method helps developers choose better algorithms depending upon their requirement by reducing over-optimization issues when selecting algorithms for problem domains such as search algorithms etc.</s>

